import React, { Component } from "react";
import { NavLink, Switch, Route, Redirect } from "react-router-dom";

import Posts from "./Posts/Posts";
import PostRender from "./Posts/PostRender";
import Authors from "./Authors/Authors";
import Images from "./Images/Images";
import Home from "./Home/Home";
import MedCalculator from "./MedCalculator/MedCalculator";

export default class Blog extends Component {
    render() {
        return (
            <div>
                <nav class="navbar navbar-expand-lg navbar-light bg-light"> 
                    <a class="navbar-brand" href="#">HowardLu</a>
                    <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
                     <span class="navbar-toggler-icon"></span>
                    </button>
                <button className="nav-item nav-link active">
                    <NavLink to="/home">Home</NavLink>
                </button>
                <button>
                    <NavLink to="/posts">Posts</NavLink>
                </button>
                <button>
                    <NavLink to="/authors">Authors</NavLink>
                </button>
                <button>
                    <NavLink to="/images">Images</NavLink>
                </button>
                <button>
                    <NavLink to="/medCalculator">MedCalculator</NavLink>
                </button>
                </nav>
                <hr />
                <Switch>
                    <Route exact path="/posts" component={Posts} />
                    <Route path="/posts/:id?" component={PostRender} />
                    <Route exact path="/authors" component={Authors} />
                    <Route exact path="/images" component={Images} />
                    <Route exact path="/home" component={Home} />
                    <Route exact path="/medcalculator" component={MedCalculator} />
                    <Redirect from="/home" to="/" />
                </Switch>
            </div>
        );
    }
}
